import Heart from "./Heart"

const ImgCard = ({ foto, changeLiked }) => {
  return (
    <div className='foto' style={{ backgroundImage: `url(${foto.src.tiny})`}} onClick={() => changeLiked}></div>
  )
}

export default ImgCard
